import { Button, Container, Typography, Box, Grid, Card, CardContent } from "@mui/material";
import { useNavigate } from "react-router-dom";
import { Psychology, Devices, AccessTime } from "@mui/icons-material";

export default function Home() {
  const navigate = useNavigate();

  return (
    <Box>
      {/* Hero Section */}
      <Box
        sx={{
          background: 'linear-gradient(135deg, #2E7D32 0%, #4CAF50 50%, #66BB6A 100%)',
          minHeight: '60vh',
          display: 'flex',
          alignItems: 'center',
          position: 'relative',
          overflow: 'hidden',
          '&::before': {
            content: '""',
            position: 'absolute',
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
            background: 'url("data:image/svg+xml,%3Csvg width=\'60\' height=\'60\' viewBox=\'0 0 60 60\' xmlns=\'http://www.w3.org/2000/svg\'%3E%3Cg fill=\'none\' fill-rule=\'evenodd\'%3E%3Cg fill=\'%23ffffff\' fill-opacity=\'0.1\'%3E%3Ccircle cx=\'30\' cy=\'30\' r=\'1\'/%3E%3C/g%3E%3C/g%3E%3C/svg%3E")',
          }
        }}
      >
        <Container maxWidth="lg" sx={{ position: 'relative', zIndex: 1 }}>
          <Grid container spacing={4} alignItems="center">
            {/* Left side - Main content */}
            <Grid item xs={12} md={6}>
              <Box sx={{ color: 'white', textAlign: { xs: 'center', md: 'left' } }}>
                <Typography
                  variant="h6"
                  sx={{
                    fontWeight: 300,
                    mb: 2,
                    opacity: 0.9,
                    letterSpacing: '0.5px'
                  }}
                >
                  Test Vocacional
                </Typography>

                <Typography
                  variant="h2"
                  sx={{
                    fontWeight: 700,
                    mb: 2,
                    fontSize: { xs: '2.5rem', md: '4rem' },
                    lineHeight: 1.1,
                    textShadow: '0 2px 4px rgba(0,0,0,0.3)'
                  }}
                >
                  Visualiza
                  <Box component="span" sx={{ color: '#E8F5E8' }}>
                    URP
                  </Box>
                </Typography>

                <Typography
                  variant="h5"
                  sx={{
                    fontWeight: 400,
                    mb: 4,
                    opacity: 0.95,
                    fontSize: { xs: '1.2rem', md: '1.5rem' },
                    maxWidth: '500px',
                    mx: { xs: 'auto', md: 0 }
                  }}
                >
                  ¡Descubre tu carrera ideal!
                </Typography>

                <Button
                  variant="contained"
                  size="large"
                  onClick={() => navigate("/test")}
                  sx={{
                    bgcolor: '#1B5E20',
                    color: 'white',
                    px: 4,
                    py: 1.5,
                    fontSize: '1.1rem',
                    fontWeight: 600,
                    borderRadius: '30px',
                    textTransform: 'uppercase',
                    letterSpacing: '1px',
                    boxShadow: '0 4px 20px rgba(27,94,32,0.3)',
                    transition: 'all 0.3s ease',
                    '&:hover': {
                      bgcolor: '#0D4E14',
                      transform: 'translateY(-2px)',
                      boxShadow: '0 6px 25px rgba(27,94,32,0.4)',
                    }
                  }}
                >
                  Inicia el Test
                </Button>
              </Box>
            </Grid>

            {/* Right side - Placeholder for students image */}
            <Grid item xs={12} md={6}>
              <Box
                sx={{
                  height: { xs: '250px', md: '400px' },
                  background: 'rgba(255,255,255,0.1)',
                  borderRadius: '20px',
                  border: '2px dashed rgba(255,255,255,0.3)',
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                  backdropFilter: 'blur(10px)',
                  position: 'relative'
                }}
              >
                {/* Aquí puedes agregar tu imagen así: */}
                {/* <img 
                  src="/images/estudiantes-urp.jpg" 
                  alt="Estudiantes URP"
                  style={{ 
                    width: '100%', 
                    height: '100%', 
                    objectFit: 'cover', 
                    borderRadius: '18px' 
                  }}
                /> */}
                <Typography
                  variant="h6"
                  sx={{
                    color: 'rgba(255,255,255,0.8)',
                    textAlign: 'center',
                    fontWeight: 300
                  }}
                >
                  [Imagen de estudiantes URP]
                </Typography>
              </Box>
            </Grid>
          </Grid>
        </Container>
      </Box>

